CREATE TABLE `patientecurrentsatus_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fk_patient` bigint(20) NOT NULL COMMENT 'This table will store only the current status of the patient.\nEach change, makes to save the current staus in a history table and the aplly the changes in a history table.\nOnce the tratement has ended, this is the final status, grab the whole line, save inside the history and delete from current status. ',
  `disp_name_patient` varchar(100) NOT NULL,
  `paciente_session` varchar(50) NOT NULL COMMENT 'That will be a number like SESSION. Composed by \npatient.nb_dossier+datetime+milisseconds. (created by the system)\n\nthis number will be used to track a patinent session in te service.\nwill be used to link to exams',
  `fk_exam_status_type` int(11) NOT NULL DEFAULT '0' COMMENT '0-N/A (no exams was assigned)\n1-waiting (at laste one exam was not done)\n2-done (all exams in the list must be done)\n\n',
  `disp_exam_status_type` varchar(100) NOT NULL,
  `dt_sys_admission` datetime NOT NULL,
  `fk_tournee_medicale_fait` int(11) NOT NULL DEFAULT '0' COMMENT 'tournoi medicale was done\n0-Non\n1-Oui',
  `disp_tournee_medicale_fait` varchar(100) NOT NULL,
  `fk_tournee_med_nursing_available` int(11) NOT NULL COMMENT 'Nursing is avaliable pour le tournoi\n0-Non\n1-Oui\n',
  `disp_tournee_nursing_available` varchar(100) NOT NULL,
  `fk_patron` int(11) NOT NULL,
  `disp_name_patron` varchar(100) NOT NULL,
  `fk_type_med` int(11) NOT NULL,
  `disp_type_med` varchar(100) NOT NULL,
  `fk_fellow` int(11) NOT NULL,
  `disp_name_fellow` varchar(100) NOT NULL,
  `fk_nursing` int(11) NOT NULL,
  `disp_name_nursing` varchar(100) NOT NULL,
  `fk_pharmacist` int(11) NOT NULL,
  `roomnumber` varchar(5) NOT NULL COMMENT 'do not use id becaouse there is no room nb 13',
  `disp_name_pharmacist` varchar(100) NOT NULL,
  `fk_resident` int(11) NOT NULL,
  `disp_name_resident` varchar(100) NOT NULL,
  `fk_type_nursing` int(11) NOT NULL,
  `disp_type_nursing` varchar(100) NOT NULL,
  `fk_type_assistance_respiratoire` int(11) NOT NULL,
  `disp_type_assistance_respiratoire` varchar(100) NOT NULL,
  `fk_isolement` int(11) NOT NULL,
  `disp_isolement` varchar(100) NOT NULL,
  `fk_codevacuation` int(11) NOT NULL,
  `fk_chargetravail` int(11) NOT NULL,
  `fk_traitmentsparticuliers` int(11) NOT NULL,
  `disp_traitmentsparticuliers` varchar(100) NOT NULL,
  `fk_deplacementcritique` int(11) NOT NULL,
  `disp_deplacementcritique` varchar(100) NOT NULL,
  `note` longtext,
  `scheduled_departure` datetime DEFAULT NULL,
  `performed_departure` datetime DEFAULT NULL,
  `nb_lit_hospitalier` varchar(50) NOT NULL,
  `mouvement_alert` varchar(80) NOT NULL DEFAULT '1' COMMENT '0-Non\n1-Oui',
  `codevacuation_hexacode` varchar(8) DEFAULT NULL,
  `traitmentsparticuliers_hexacode` varchar(8) DEFAULT NULL,
  `mouvement_alert_path` varchar(80) DEFAULT '""',
  `fk_type_conge` int(11) NOT NULL,
  `disp_type_conge` varchar(80) NOT NULL,
  `disp_type_conge_hexacode` varchar(80) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=119 DEFAULT CHARSET=utf8;
